import React from 'react';
import './App.css';

function App() {
    return (
        <div className="App">
            <iframe
                id="ytplayer"
                type="text/html"
                width="640"
                height="360"
                src="https://www.youtube.com/embed/M7lc1UVf-VE?autoplay=1&origin=http://example.com"
                frameborder="0"
            ></iframe>
        </div>
    );
}

export default App;
